import { useDispatch, useSelector } from 'react-redux';
import { GetTaskList1 } from '../../Redux/Actions/GetTaskListAction';


function TaskShow() {


    useEffect(() => {
    
    
      return () => {
        disptach(GetTaskList1(sessionStorage.getItem("UserLogin")))
      }
    }, [])
    const TaskList = useSelector((state) => state.GettaskListReducer);
    const disptach  = useDispatch()
  return (
    <>

   {TaskList.map((x)=>{<li>{x.Task}</li>})}

    </>
   
  )
}

export default TaskShow
